// RunningList.js

import React, { useEffect, useState } from 'react';
import axiosInstance from '../utils/axiosInstance';

const RunningList = ({ date }) => {
  const [runnings, setRunnings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchRunnings = async () => {
      setLoading(true);
      try {
        const response = await axiosInstance.get('/runnings/get', {
          params: {
            date: date,
          },
        });
        setRunnings(response.data); // 실제 데이터가 어떤 형태인지에 따라 수정 필요
      } catch (error) {
        console.error('Error fetching runnings:', error);
        setError('러닝 목록을 가져오는 중 오류가 발생했습니다.');
      } finally {
        setLoading(false);
      }
    };

    fetchRunnings();
  }, [date]);

  if (loading) {
    return <p>Loading...</p>;
  }

  if (error) {
    return <p>{error}</p>;
  }

  return (
    <div>
      <h2>Running List for {date}</h2>
      <ul>
        {runnings.map((running) => (
          <li key={running.id}>
            <h3>{running.title}</h3>
            <p>{running.description}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default RunningList;
